import React, { Component } from "react";
class SignLog extends Component {
  render() {
    return (
      <div id="containerSignLog">
        <div id="signLog">
          <div id="signUp">
            <h2>New User? Sign Up.</h2>
            <input placeholder="Enter your email" id="newEmail"></input>
            <input placeholder="Enter new password" id="newPassword"></input>
            <input placeholder="Enter your number" id="newPhone"></input>
            <button id="newSubmit">Sign Up</button>
          </div>
          <div id="logIn">
            <h2>Already registered. Log In.</h2>
            <input placeholder="Enter your email or phone number" id="newEmailPhone"></input>
            <input placeholder="Enter your password" id="oldPassword"></input>
            <button id="newSubmit">Log In</button>
          </div>
        </div>
      </div>
    );
  }
}

export default SignLog;
